import React from 'react';

const Navbar = () => {
  return (
    <div>
    <nav class="bg-red-600 py-4 px-6 flex justify-between items-center">
    <div class="flex items-center">
      <img src="logo.png" alt="Logo" class="h-6 mr-2"/>
      <h1 class="text-white font-bold text-lg">Car Management</h1>
    </div>
    <div class="flex items-center">
      <a href="#" class="text-white mr-4">Add Car</a>
      <a href="#" class="text-white mr-4">Update Car</a>
      <a href="#" class="text-white">Delete Car</a>
    </div>
  </nav>
  </div>

  );
};

export default Navbar;
